import {Link} from "react-router-dom"
import React, { useState } from 'react'
import axios from 'axios';
import validator from 'validator';

const registrProcess = () => {
    const nameData = document.getElementsByName("name").value;
    const surnameData = document.getElementsByName("surname").value;
    const emailData = document.getElementsByName("email").value;
    const passData = document.getElementsByName("password").value;
    const passData2 = document.getElementsByName("password2").value;
    console.log({passData},{passData2});
    if(passData!=passData2){
        alert("Пароли не совпадают");
    }
}

export const SignUpPage = () => {
    return (
      <div className='Content'>
        <div className='SignUp'>
            <h1 className='HeaderSignUp'>Регистрация</h1>
            <div className="SignUpMain">
            <div className='TextSignUp'>
                <div className="SignUpForm">
                    <form>
                        <p>Имя</p>
                        <input type="text" name="name" placeholder=''/>
                        <p>Фамилия</p>
                        <input type="text" name="surname" placeholder=''/>
                        <p>Email</p>
                        <input type="email" name="email" placeholder=''/>
                        <p>Пароль</p>
                        <input type="password" name="password" placeholder=''/>
                        <p>Подтверждение пароля</p>
                        <input type="text" name="password2" placeholder=''/>
                    </form>
                    <button onClick={() => registrProcess()}>Sign Up</button>
                </div>
                <div className="SignUpLinks">
                <Link to = '/signinto' style = {{"textDecoration" : "none", "color": "#000 !important"}}>
                    <p>Already registrated?</p>
                </Link>
                </div>
            </div>
            <div className='ImgSignUp'>
                <img src={"./img/people2.jpg"} />
            </div>
            </div>
        </div>
      </div>
    )
  }
